import ReactDOM from 'react-dom/client';
import './index.css';
import './Heading';
import Heading from './Heading';

const root = ReactDOM.createRoot(document.querySelector('#root'));
root.render(
    <>
      <Heading/>
      <Para/>
      <ol>
        <li>Shivam</li>
        <li>Shiv</li>
        <li>Varshney</li>
      </ol>
    </>
);
